export default {
  name: 'ProfileCard',
  props: {
    profile: {
      type: Object,
      required: true
    }
  },
  computed: {
    genderClass: function genderClass() {
      switch (this.profile.gender) {
        case this.TIM.TYPES.GENDER_MALE:
          return 'icon-male';

        case this.TIM.TYPES.GENDER_FEMALE:
          return 'icon-female';

        default:
          return '暂无';
      }
    }
  }
};
